import FavoriteIcon from '@mui/icons-material/Favorite';
import LocationOnIcon from '@mui/icons-material/LocationOn';
import { useState } from 'react';

const FoodHeader=()=>{
 const [value,setValue]=useState()
  console.log('value=',typeof value)
  return(
  <div className='NavBar'>
    <Grid  justifyContent="center" container spacing={2} >
    <NavLink end style={({isActive})=>({color:isActive?'#9f0013':'inherit',backgroundColor:'#E0E5FF'})}  to={`/FoodList`}>
      search
          {/* <button onClick={()=>{setValue()}} className={!value?'active Navbar__Search':'Navbar__Search'}><SearchIcon sx={{ color: grey[900] }} /></button> */}
    </NavLink> 
        

    <NavLink  style={({isActive})=>({color:isActive?'#9f0013':'inherit',backgroundColor:'#E0E5FF'})} to={`/FoodList/FavoriteFood`}>
       favorites {/* <button onClick={()=>{setValue(1)}} className={value?'active Navbar__Search':'Navbar__Search'}><FavoriteBorderIcon sx={{ color: grey[900] }} /></button> */}
    </NavLink>
        
    </Grid>
  </div>
  )
}
export default FoodHeader;
